description: |+
  LUVOCOM 3F PAHT 9936 is a PA6 filament that is engineered for quality controlled 3D printing of end-use parts that require strength and toughness in combination with a high temperature resistance.

  Luvocom 3F PAHT 9936 BK is a high-temperature resistant PA6 (polyamide) filament which is engineered for industrial applications.  The material exhibits a 50% lower water uptake at a four times slower rate compared to standard PA6 nylon filaments. On top of that, it is temperature-resistant up to 160 °C. It is the perfect choice for 3D printing functional prototypes and end-use parts due to its extremely high dimensional accuracy.

  Luvocom 3F PAHT 9936 BK features the strength and toughness of pure PA6 nylon without sacrificing any of its printability. It is optimized for 3D printing strong parts with a high quality surface appearance.
  Key features

      Lehvoss Luvocom 3F PAHT 9936 BK inside
      Unreinforced PA6 filament with high strength and toughness 
      Temperature resistant up to 160 °C (200h)
      50% reduced water uptake at a four times slower rate compared to other PA6 filaments
      Tensile strength up to 78 MPa
      3D prints with high dimensional accuracy and increased layer adhesion
      Good electrical properties

   
  Applications

      Dynamically-stressed parts
      Functional prototypes
      Jigs, tools, and fixtures
      End-use parts

